import styled from "styled-components";

export const ContentSection=styled.section`
    text-align:center;
    padding-top: 7.5rem;
    padding-bottom: 7.5rem;
`
export const Title = styled.p`
font-family: fantasy;
font-size: 3rem;
color: #444444;
background: #FFFFFF;
text-shadow: 2px 4px 5px rgba(36,92,108,0.61);
`
